import React from 'react';
import './SearchPage.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {
  faMagnifyingGlass,
  faMapLocationDot,
  faPhone,
  faX,
} from '@fortawesome/free-solid-svg-icons';

const SearchPage = () => {
  return (
    <div className='search_page'>
      <p className='logo'>HOTPLACE</p>
      <ul className='local_search'>
        <li>지역검색</li>
      </ul>
      <div className='box'>
        <input type='checkbox' id='check' />
        <div className='input_box'>
          <input type='text' placeholder='Search...' />
          <a href='#' for='check' className='search'>
            <FontAwesomeIcon
              icon={faMagnifyingGlass}
              style={{ color: '#ffffff' }}
            />
          </a>
        </div>
      </div>
      <div className='hotplace'>
        <div className='number'>
          <FontAwesomeIcon icon={faPhone}></FontAwesomeIcon>
          02-717-5509
        </div>
        <div className='location'>
          <FontAwesomeIcon icon={faMapLocationDot}></FontAwesomeIcon>
          서울 마포구 고산길 16
        </div>
        <div className='name'>
          <div className='text-wrapper'>투다리 서강점</div>
        </div>
        <div className='photo'>
          <div className='group'>
            <img className='vector-4' alt='Vector' src={'./assets/to.jpeg'} />
          </div>
        </div>
      </div>
    </div>
  );
};

export default SearchPage;
